import React from 'react'
import './Services.css'
import HeartEmoji from "../../img/heartemoji.png";
import Glasses from "../../img/glasses.png";
import Humble from "../../img/humble.png";
import Card from '../Box/Box';


const Services = () => {
  return (
    <div className="services">

        {/* right side */}
        <div className="cards">

            {/* first card */}
            <div style={{left: '50rem'}}>
                <Card
                emoji = {HeartEmoji}
                heading = {'Design'}
                detail = {"Figma, Sketch, Photoshop"}
                />
            </div>

            {/* Second card */}
            <div style={{top: '2rem',left: "-1rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>

            {/* Third card */}
            <div style={{top: '19rem',left: "14rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>

            <div style={{top: '29rem',left: "14rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>

            <div style={{top: '39rem',left: "14rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>

            <div style={{top: '49rem',left: "14rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>


        </div>

    </div>
  )
}

export default Services
